import { useCallback } from "react";
import { useAdminPanel } from "../../../hooks/useAdminPanel.js";
import { getThemeValue } from "../../AdminSpace/SettingsModalBlock/GlobalSettings/ThemeSelect/ThemeSelect.jsx";


function AnybackLogo({
    side,
    href,
    ...props

}) {
    var adminPanel = useAdminPanel();

    side ||= "50px";
    
    var LogoWrapper = ({...wrapProps}) => (
        href
        ? (
            <a
                {...props}

                href={href}
                target="_blank"
                style={{
                    ...(props.style || {}),
                    width: side,
                    height: side,
                    cursor: "pointer",
                }}
            >
                {wrapProps.children}
            </a>
        )
        : (
            <>
                {wrapProps.children}
            </>
        )
    )

    var getLogoBaseString = useCallback(() => (

        getThemeValue(adminPanel.userData.theme) === 'dark'
        ? ""
        : ""
        
    ), [adminPanel.userData.theme])
    
    return (
        
        <LogoWrapper>

            <img
                
                src={
                    `data:image/png;base64, ${ getLogoBaseString() }`
                }
                className="AnybackLogo"
                alt="The official logo of the open source admin panel called AnyBack"
                
                style={{
                    ...(href ? {}: (props.style || {})),
                    width: side,
                    height: side,
                    userSelect: 'none',
                    pointerEvents: "none",
                }}
            />
            
        </LogoWrapper>

    )
}

export default AnybackLogo;
